import React from 'react';
import './ThankYou.css';

export default function ThankYou()
{
    return(
        <div id = "ty-wrapper">
        <div id = "thank-you-page-title">
            Thank you! <br /> &#128512; &#128077;
        </div>
        <div id = "thank-you-page-blurb">
            Thank you so much for registering with us! We will send you an email or call you within two weeks in order to set up lessons. It is because of you that we are able to continue serving our dreams.
        </div>
        </div>
    )
}
